INSERT INTO `news` (`id`, `affect`, `title`, `image`, `content`, `show`) VALUES
(1, ',com01,com02,com03,stk01,stk02,stk03,stk04,stk05,stk06,stk07,stk08,stk09,stk10,stk11,stk11,stk13,stk14,stk15,stk16,stk17,stk18,stk19,stk20,stk21,stk22,stk23,stk24,stk25,stk26,stk27,stk28,stk29,stk30,', 'Opposition party set for clear majority in national elections', 'election2.jpg', '<p>The pro growth , pro investor opposition nationalist party is on course to emerge the biggest in general elections due by May, two opinion polls showed on Thursday.</p><br> \r\n<p>The party  is set to win 188 seats in the 543-seat parliament, over twice the predicted tally of the current government, according to a poll on Thursday by pollsters CVoter and the India Today media group. </p><br>\r\n<p>Given India''s diverse and fragmented electorate no party  is expected to win the 272 seats needed for an outright majority. The biggest party will seek to form a coalition with regional parties. </p><br>\r\n<p>The current government, which has yet to name its prime ministerial candidate, faces an uphill struggle this year due to public anger over a string of corruption scandals and economic growth hitting a decade-low. </p><br>\r\n<p>The opposition, which  has presided over rapid economic growth during more than 12 years in Gujarat, has been wooing voters by pointing to its track record as a party that cuts red tape and attracts investment. </p><br>\r\n<p>However given the nature of the elections the opinion polls have often been way off mark as seen in the 2003 and 2009 national elections. </p><br>\r\n', 'Y'),
(2, ',com01,com03,stk07,stk08,stk09,stk22,stk23,stk24,stk25,stk26,stk27,', 'Blackouts widen as coal stocks drop at power plants', 'coal.jpg', '<p>Blackouts in India widened as inadequate coal supplies forced plants to shut down, after increased industrial activity and a monsoon deficit boosted electricity demand from factories and households. Thermal power coal stocks are at the lowest levels since the blackouts of 2012. </p><br>\r\n<p> The national peak shortage on Friday expanded to more than 6% from the 3.9% average in July, according to data from the Power Ministry and Power System Operation Corp., a unit of Power Grid Corp. of India Ltd. Stocks at power stations run on local coal plunged. Equipment breakdowns or maintenance also caused other plants to be under shutdown, including ones operated by Tata Power Co. Ltd and Adani Power Ltd. </p><br>\r\n<p>A surge in economic activity has led to higher demand for the fuel, exacerbating supply bottlenecks caused by heavy rains at some mines and slow railway transport in places. India’s economy grew at the fastest pace in more than two years, the Central Statistical Office said in a statement in New Delhi on Friday. Slow economic activity had caused coal stocks at power plants to swell last year. </p><br>\r\n', 'Y'),
(3, ',com01,com02,com03,stk01,stk02,stk03,stk04,stk05,stk06,stk07,stk08,stk09,stk10,stk11,stk11,stk13,stk14,stk15,stk16,stk17,stk18,stk19,stk20,stk21,stk22,stk23,stk24,stk25,stk26,stk27,stk28,stk29,stk30,', 'RBI set to cut interest rates', 'Rbi.jpg', '<p>Sharp rate cuts are in store in the next fiscal,as the Reserve Bank of India (RBI)’s commitment to bring down inflation , even if the US Federal Reserve starts raising interest rates, experts believe. </p><br>\r\n\r\n<p>RBI is committed to bringing down retail inflation six per cent by January 2016. Though CPI-based inflation rose to 7.96 per cent in July from 7.46 per cent in June, it is seen stabilising in the months ahead. </p><br>\r\n\r\n<p>RBI had previously raised the repo rate in January, by 25 bps to eight per cent. Since then, status quo has been maintained in the past three bi-monthly monetary policy reviews. </p><br>\r\n\r\n<p> “Any rate cut shall fuel a rally in the bond market. If there has to be a meaningful rate cut, at least 50 bps should be there. This kind of cut will result in 10-year bond yield falling to eight per cent,” said Anoop Verma, vice-president for treasury at Development Credit Bank. </p><br>\r\n', 'Y'),
(4, ',com01,com02,stk04,stk05,stk06,', 'RBI tightens gold import norms', 'gold.jpg', '<p>Seeking to restrict gold imports, the Reserve Bank on Friday said nominated banks and agencies will not be allowed to import the precious metal in excess of their entitlements in first or second lot under 80:20 scheme. </p><br>\r\n\r\n<p>The government under the 80:20 scheme had in August 14, 2013, allowed nominated agencies to import gold on the condition that 20 per cent of the inward shipment will be exported. The permission to import the next lot would be given on fulfilment of export obligation. </p><br>\r\n\r\n<p>To contain rising gold import, which was 162 tonnes in May, the government had hiked import duty on gold thrice in the current year taking it 10 per cent. Besides, the RBI also came out with certain restrictions, including the 80:20 scheme for imports. The gold imports came down to 19 tonnes in November. </p><br>\r\n', 'Y'),
(5, ',com01,com02,stk04,stk05,stk06,', 'Gold import norm relaxed', 'gold.jpg', '<p>The Reserve Bank of India (RBI) on Wednesday liberalised gold import norms under the 80:20 rule. Though the ratio hadn’t been changed, star and premier export houses had been allowed to import the commodity, while banks and nominated agencies had been allowed to provide gold for domestic use as loans to jewellers and bullion traders, said a notification issued by RBI. </p><br>\r\n\r\n<p>The new norms come into force with immediate effect.Under the 80:20 scheme, the government had, on August 14 last year, allowed nominated agencies to import gold on the condition that 20 per cent of the import would be exported. </p><br>\r\n\r\n<p>It is expected Wednesday’s move will increase monthly average gold import from 25-30 tonnes to 50-60 tonnes. Also, jewellers’ cost of funds could decline with the resumption of gold loan facilities. </p><br>\r\n\r\n\r\n<p>Banks importing gold will find it easy to import for domestic use, subject to 20 per cent export. While gold loans cannot be more than the allowed sale limit in the domestic market, after meeting export requirements, they will be able to import gold for the domestic market on a consignment basis and give this to jewellers as loans. </p><br>\r\n', 'Y'),
(6, ',com01,com02,com03,stk01,stk02,stk03,stk04,stk05,stk06,stk07,stk08,stk09,stk10,stk11,stk11,stk13,stk14,stk15,stk16,stk17,stk18,stk19,stk20,stk21,stk22,stk23,stk24,stk25,stk26,stk27,stk28,stk29,stk30,', 'Below average monsoon expected', 'monsoon.jpg', '<p>The current government’s task at hand has got tougher. Now, add weak monsoon to the list of other economic challenges he faces: Worst slowdown in decades, high level of inflation, high interest rates, weak manufacturing growth and poor infrastructure, among others. </p><br>\r\n\r\n<p>The Indian Meteorological Department in its second estimate on Monday has forecast that the rainfall during the June-September monsoon is likely to be 7 per cent below normal, worse than its April forecast of 5 per cent below normal rainfall. This has got significant implications for an economy that grew 4.7 per cent in the most recent fiscal year, nearly half the rate that is required to provide jobs to millions entering the workforce every year. </p><br>\r\n\r\n<p>The government has said that it is readying contingency plans for a weak monsoon and also committed to invest in agricultural infrastructure to boost production. Though boosting infrastructure will take time, the government could be helped in its fight against weak monsoon by the comparatively higher levels of water in rivers. "A bit of good news is that rivers are running relatively full. In particular, the Ganga, which waters the rice fields of the north and the east, is flowing at 2.4 times its 10-year average, Bank of America said in a report. </p><br>\r\n\r\n<p>The meteorological department will issue its next forecast in end-July. </p><br>\r\n \r\n', 'Y'),
(7, ',stk16,stk17,stk18,', 'DLF shares sink 9% after court cancel land deal', 'dlf.jpg', '<p> Shares of DLF on Thursday plunged after the Punjab and Haryana high court set aside the state government''s decision to allot 350 acres of land in Gurgaon to the realty major in 2010. </p><br>\r\n<p>The Punjab and Haryana high court on Wednesday set aside Haryana government''s decision to allot 350 acres of land at Wazirabad in Gurgaon to real estatedeveloper DLF in 2010. </p><br>\r\n<p>A division bench of the court yesterday directed Haryana the government to conduct an auction of the land in question by inviting international bids within a month. </p><br>\r\n\r\n<p>However, DLF would be able to participate in the auction process. </p><br>\r\n\r\n', 'Y'),
(8, ',com01,com02,com03,stk01,stk02,stk03,stk04,stk05,stk06,stk07,stk08,stk09,stk10,stk11,stk11,stk13,stk14,stk15,stk16,stk17,stk18,stk19,stk20,stk21,stk22,stk23,stk24,stk25,stk26,stk27,stk28,stk29,stk30,', 'Sensex snaps election rally as profit-booking emerges', 'sensex.jpg', '<p>Snapping rally on election euphoria, the BSE benchmark sensex today fell from record highs to close lower on profit-booking amid weak global trends. </p><br>\r\n<p>The rally before today''s losses saw the BSE sensex and NSE Nifty climbing to life-time high, when the pro growth , pro investor opposition nationalist party was said to win a majority in the upcoming national elections by various opinion polls. </p><br>\r\n\r\n<p>Brokers said the market was in over-bought position following recent record setting spree on robust capital inflows on expectations of a stable government. Bourses saw emergence of selling by foreign funds after remaining major buyers for nearly one month on Indian bourses, they added. </p><br>\r\n\r\n<p>Foreign institutional investors (FIIs) sold shares worth a net Rs 104.53 crore yesterday as per provisional data from stock exchanges. </p><br>\r\n\r\n<p>They said the fall was somewhat cushioned by gains IT, realty, auto, FMCG, power and consumer durables and PSU stocks which maintained their upward journey on sustained buying. </p><br>\r\n\r\n', 'Y'),
(9, ',com01,stk04,stk05,stk06,', 'CBI arrests ICICI Bank CMD in Rs 50 lakh bribery case', 'icici.jpg', '<p>The Central Bureau of Investigation (CBI) on Saturday arrested the chairman and managing director of ICICI bank , his brother-in-law and four others for allegedly accepting a bribe to enhance the credit limit of private companies bypassing rules, making it one of most high profile cases involving a serving state-run bank chief in over two decades. </p><br>\r\n\r\n<p>CBI officials said he was arrested from Mumbai when one of his relatives, a chartered accountant, was taking Rs 50 lakh as bribe from a private company. Two companies for which Jain allegedly raised the credit limit are Prakash Industries and Bhushan Steel, which are being probed by the CBI in the coal block allocation scam, officials at the agency said. </p><br>\r\n\r\n<p>Top CBI officials told TOI that they have recovered several documents, computer records and evidence which show that many other banks are involved in the scandal through the same set of middlemen. "We will probe the larger conspiracy involving other banks as we have recovered huge amount of incriminating material," said CBI Director Ranjit Sinha. </p><br>\r\n', 'Y'),
(10, ',stk19,', 'L&T  to gain after JV firm wins NTPC order', 'lnt.png', '<p>Larsen & Toubro  through its joint venture firm, L&T-MHPS Boilers, secured an order worth Rs 1885 crore from NTPC. </p><br>\r\n<p>The announcement was made during trading hours today. </p><br>\r\n<p>The contract includes setting up of two units of 660 MW each supercritical steam generators for Tanda Thermal Power Plant Stage-II on an engineering, procurement and construction (EPC) basis, Larsen & Toubro (L&T) said in a statement. </p><br>\r\n<p>L&T-MHPS Boilers (LMB)''s scope includes design, engineering, supply, construction, erection, testing, commissioning and conducting performance guarantee of two coal-fired steam generator units with supercritical parameters. The project site is located on the banks of the Tanda canal near Bahadurpur village in the Ambedkar Nagar district of Uttar Pradesh, the company said. </p><br>\r\n<p>This is LMB''s first order for supercritical steam generators from NTPC. The order was won through competitive bidding involving several national and international players. The project is scheduled to be completed in 46 and 52 months for the respective units. </p><br>\r\n<p>L&T is a $14.3 billion technology, engineering, construction, manufacturing and financial services conglomerate, with global operations. </p><br>\r\n', 'Y'),
(11, ',stk07,stk08,stk09,', 'Tata Steel Signs Deal With Subsea 7 To Supply Pipes Worth €10 Million', 'tatasteel.jpg', '<p>Tata Steel has signed contracts worth 10 million (Rs 82 crore) with Subsea 7 to supply undersea pipes. </p><br>\r\n\r\n<p>"The four contracts, signed over the past year and worth an estimated Euro 10 million in total, will see Tata Steel supply in excess of 55 km of pipe weighing more than 9,000 tonnes," the company said in a statement. </p><br>\r\n\r\n<p>As per the contracts, Tata Steel will supply 28 km of carrier pipe and 27 km of sleeve pipe. </p><br>\r\n\r\n<p>Tata Steel said it has also signed a global framework agreement with Subsea 7 to further strengthen the companies'' long-standing partnership, which began 25 years ago. </p><br>\r\n\r\n<p>"This latest series of contracts further demonstrates the breadth of our offering to the Energy & Power sector. Over the last 25 years, we have provided more than 83,000 tonnes of pipe to Subsea 7 for 37 projects worldwide," said Richard Broughton, commercial manager, exploration and production, energy & power, Tata Steel. </p><br>\r\n', 'Y'),
(12, ',com01,stk04,', 'SBI posts first profit in 6 months', 'sbi.jpg', ' <p>State Bank of India reported a modest net profit growth of 3.3%, the first increase in six quarters, as lending and interest margins improved. The bank posted a net profit of Rs 3,349 crore for this quarter, an increase of 3.3% compared to Rs 3,241 crore for the previous quarter. </p><br>\r\n\r\n<p>Announcing the results, the bank''s chairman Arundhati Bhattacharya said that operating profits of Rs 8,788 crore for the first quarter, up 16% from the corresponding quarter last year, was the highest ever recorded by the bank. </p><br>\r\n\r\n\r\n<p>The bank has grown its deposits by 12.85% to Rs 14,18,915 crore, while its gross advances rose 12.52% to Rs 12,32,288 crore. The increase in credit was due to borrowing by large corporates, including some stalled projects that had been restarted. Home loans grew by 12% to Rs 1,44,210 crore over the previous year. </p><br>\r\n', 'Y'),
(13, ',stk10,stk11,stk12,', 'Cipla enters into collaboration with S&D Pharma', 'Cipla.jpeg', '<p>Cipla has announced a commercial collaboration with S&D Pharma to enter Czech Republic and Slovakia with affordable high quality alternatives. </p><br>\r\n<p>Under the collaboration, Cipla will be driving its respiratory product portfolio in both Czech Republic\r\nand Slovakia through a Cipla owned sales force team, managed by Cipla commercial head. S&D Pharma\r\nwill physically distribute all products, including respiratory products, and this portfolio will increase over\r\nthe next few years. </p><br>\r\n<p>Frank Pieters, Head Cipla Europe said, “We are excited to partner with S&D Pharma and believe that this collaboration will enable us to drive access in the Czech Republic and Slovakia across therapy areas in the coming years.” </p><br>\r\n', 'Y'),
(14, ',com01,com02,com03,stk01,stk02,stk03,stk04,stk05,stk06,stk07,stk08,stk09,stk10,stk11,stk11,stk13,stk14,stk15,stk16,stk17,stk18,stk19,stk20,stk21,stk22,stk23,stk24,stk25,stk26,stk27,stk28,stk29,stk30,', 'Iraq unrest drives up oil, world shares edge higher', 'iraq1.jpg', '<p>Escalating violence in Iraq drove crude oil prices to nine-month highs on Friday while damping the appetite for risk, even as bullish news from the US tech sector lifted shares onWall Street and helped buoy stocks in global equity markets. </p><br>\r\n\r\n<p>Iraq''s most senior Shi''ite cleric urged his followers to take up arms to defend themselves against advancing Sunni militants, escalating a conflict that threatens civil war and a possible break-up of the country. </p><br>\r\n', 'Y'),
(15, ',com01,com02,com03,stk01,stk02,stk03,stk04,stk05,stk06,stk07,stk08,stk09,stk10,stk11,stk11,stk13,stk14,stk15,stk16,stk17,stk18,stk19,stk20,stk21,stk22,stk23,stk24,stk25,stk26,stk27,stk28,stk29,stk30,', 'Islamic terrorists seize Saddam Hussein’s hometown after 500,000 flee unrest in Iraq’s second-largest city, Mosul', 'iraq2.jpg', '<p>Al-Qaeda-inspired militants seized effective control Wednesday of Saddam Hussein’s hometown of Tikrit, expanding their offensive closer to the Iraqi capital as soldiers and security forces abandoned their posts following clashes with the insurgents. </p><br>\r\n<p>Fighters from the Islamic State of Iraq and Al-Sham (ISIS) took control a day earlier of much of Mosul, Iraq’s second-largest city, in a major blow to the authority of the country’s Shiite government. </p><br>\r\n<p>An estimated half a million residents fled the economically important city. </p><br>\r\n<p>Residents reached by telephone in Sunni-dominated Tikrit said the Sunni militant group had taken over several police stations. They spoke on condition of anonymity for fear of their safety. </p><br>\r\n<p>Two Iraqi security officials confirmed Tikrit was under the control of the ISIS, and said the provincial governor was missing. The officials insisted their names not be used because they weren’t authorized to release the information. Tikrit, the capital of Salahuddin province, is 130 kilometres north of Baghdad. </p><br>\r\n', 'Y'),
(16, ',stk01,stk02,stk03,', 'Infosys to provide IT services to BP', 'infosys.jpg', '<p>Bangalore-based Infosys Ltd, India’s second largest software exporter, has been selected by British oil and gas company BP Plc to provide application support and development to improve its business information technology (IT) processes across all key functions. </p><br>\r\n<p> The agreement is effective 1 September 2014. The agreement’s geographical scope includes BP’s main facilities in Houston, Texas, and in the UK, as well as support in locations as diverse as Azerbaijan, Angola, Brazil and Singapore. Central to these services, Infosys will also continue to invest in the Infosys Information Systems and Technology University. This academy provides training to Infosys engineers in industry knowledge, technology systems, BP processes and key applications. </p><br>  \r\n<p>Rajesh K. Murthy, executive vice-president and global head, energy, communications and services, Infosys, said: “Winning this contract demonstrates how we have evolved as a supplier and continue to work collaboratively with BP across their range of activities.” </p><br>\r\n', 'Y'),
(17, ',stk13,stk14,stk15,', 'India’s car exports down 5% in April-July', 'carexports.jpg', '<p>India’s ambitious plan to become a global hub for small-car exports has taken a hit due to falling shipments to Europe, while an unfavourable environment in neighbouring countries has led to lost opportunities worth around $2 billion. </p><br>\r\n<p> According to the latest data from the Society of Indian Automobile Manufacturers (SIAM) for the April-July period this fiscal, car exports were down 5.02% to 171,274 units as against 180,332 units in the year-ago period. </p><br>\r\n<p> “Today Indian export of cars is re-orienting. Earlier, exports were mostly to Europe and South Asia but both are down and companies are focusing on building new markets in Latin America and Africa,” SIAM director general Vishnu Mathur said. He further said that it would take time to recover from the loss incurred in Europe and neighbouring countries. Already, India’s largest car exporter Hyundai Motor Co. has stopped shipments from its Chennai plant to Europe after shifting production of models for the continent to the Korean auto major’s plants in Turkey and the Czech Republic. The move will result in a reduction of around 25% in overseas shipments from the company’s Chennai plant this year at 190,000 units, compared to 253,000 units last year. The company accounted for 45% of all cars exported from India last year. On the other hand, challenges in neighbouring countries like Sri Lanka, Bangladesh and Nepal has also resulted in lost opportunities for Indian car exports. </p><br>\r\n<p>When asked how much the loss could be, SIAM deputy director general Sugato Sen said: “We could have exported $2 billion worth of cars to our neighbourhood.” The auto industry had set an ambitious target under the Automotive Mission Plan (AMP) 2006-2016 to take its annual turnover to $145 billion with special emphasis on export of small cars, MUVs, two- and three-wheelers and auto components. However, the slowdown in both global and domestic automotive market in the last couple of years had led SIAM to announce last year that it would miss the annual turnover target by $34 billion. </p><br>\r\n', 'Y'),
(18, ',stk13,stk14,stk15,', 'Haryana government asks Maruti to stall construction of an upcoming R&D facility in Rohtak', 'marutiplant.jpg', '<p>In a setback to the government''s "Make In India" drive, Maruti Suzuki has been compelled by the Haryana government to stop all construction work on a facility at Rohtak that was to develop and test cars for India and the world, the first such unit being set up outside Japan by the local auto maker''s parent, Suzuki Motor. </p><br>\r\n<p>The Rs 3,500-crore-plus R&D project was expected to be operational by next year, but is now on hold as the state government has initiated prosecution against the company for beginning construction without obtaining an environmental clearance and has appealed a Delhi High Court verdict asking it to refrain from taking action against Maruti. </p><br>\r\n', 'Y'),
(19, ',stk13,stk14,stk15,', 'Govt clears road for other cars as Ambassador drives out', 'ambasador.jpg', '<p>With Hindustan Motors halting production of its iconic Ambassador car that was almost eponymous with the ‘sarkari lal batti’ car, the government, too, has opened its gates for other vehicles that can be used as staff cars. </p><br>\r\n<p>The finance ministry has said that cars with a net dealer price of up to Rs 4,75,000 can be purchased as staff cars by ministries. </p><br>\r\n<p> “The ministry has been receiving requests from various ministries and departments for inclusion of new models of cars or alternatively to purchase certain vehicles for use as staff cars… since many of the approved cars are no longer under manufacture,” the department of expenditure in the finance ministry said in a missive to all ministries earlier this month.</p><br>\r\n', 'Y'),
(20, ',com01,com02,com03,', 'Forex reserves down by $1.32bn ', 'forexdown.jpg', '<p>Falling to a near-eight week low, India''s foreign exchange reserves fell by $1.327 billion to $317.313 billion in this week, as the country''s central bank sold dollars to prevent currency volatility. </p><br>\n<p>Foreign currency assets, a key component of reserves, fell by $1.029 billion to $290.364 billion, RBI’s weekly statistical statement showed.After remaining unchanged for many weeks, gold reserves too fell by $241 million to $20.933 billion. </p><br>\n<p>Governor Raghuram Rajan last week said that RBI is preparing for the withdrawal exit from low rates by the US policy makers by building ‘adequate level’ of reserves and curbing volatility in foreign exchange market. </p><br>\n<p>The forex reserves had ended marginally higher by $60.5 million ($0.060 billion) to $318.640 billion as of last week. </p><br>\n', 'Y'),
(21, ',com01,com02,com03,', 'Forex Reserves Up at $319.39 Billion', 'forexup.jpg', '<p>After falling for two consecutive weeks, foreign exchange reserves marginally rose to $319.39 billion, up by $43.3 million, for this week, driven by an increase in foreign currency assets. </p><br>\n<p>The reserves had fallen by $643.3 million to $319.347 billion in August, while they had dropped by $573.5 million to $319.99 billion in September after touching close to a life-time high of $321 billion in the previous week. </p><br>\n<p>Foreign currency assets (FCAs), a major constituent of overall reserves, increased by $54.7 million to $292.101 billion for is week, the Reserve Bank of India said in its weekly statement in Mumbai on Friday.</p><br>\n', 'Y'),
(22, ',stk28,stk29,stk30,', 'Bharti Airtel to sell 3,500 mobile towers in Africa', 'airtel.jpg', '<p> Sunil Mittal-led Bharti Airtel will sell more than 3,500 of its mobile towers in six African countries to tower operator Eaton Towers in its bid to reduce costs, exit non-core businesses and raise cash in the run-up to the upcoming spectrum auctions.</p><br>\r\n<p>India''s No. 1 mobile carrier will lease back the towers from Eaton under a 10-year pact, both companies said in a joint statement on Monday, although they did not disclose the size of the 3,500-plus towers sale deal. Two people familiar with the transaction, however, told ET that the deal size would be close to $900 million (about Rs 5,400 crore). </p><br>\r\n<p>The Airtel-Eaton tower deal is also in the run-up to a potential sale of Airtel''s Nigerian tower assets in under three weeks that is tipped to rake in over $1 billion. American Tower Co (ATC) is reportedly the front runner to buy Airtel''s 4,000-odd towers in Nigeria, followed by IHS Towers. </p><br>\r\n', 'Y'),
(23, ',com01,com02,com03,stk01,stk02,stk03,stk04,stk05,stk06,stk07,stk08,stk09,stk10,stk11,stk11,stk13,stk14,stk15,stk16,stk17,stk18,stk19,stk20,stk21,stk22,stk23,stk24,stk25,stk26,stk27,stk28,stk29,stk30,', 'Ruling party registers shock victory over opposition in General elections', 'election.jpg', '<p>The Lok Sabha elections drew to a close today with the ruling coalition party retaining the necessary 2/3rds majority in the house by a mere 3 seats, with a total margin of 2,99,239 votes. As was the case in 2003 and 2009, the opinion polls have once again proved to be unreliable as the have been way of mark yet again.</p><br>\r\n<p>While the newly elected coalition released a statement thanking voters, they maintained that they were not surprised by the people’s decision. As a newly elected MP said, “After 5 years of development at our hands, India is simply expressing its gratitude.”</p><br>\r\n\r\n<p>The scene at the opposition camp was far from jubilant . Former members of parliament wasted no time in taking to Twitter to express their disgust at the decision. “Criminals win again,” tweeted the opposition, joining in a chorus of allegations of foul-play in the country.</p><br>\r\n<p>Investors expressed similar sentiments as experts predict that the peoples demand for change and rapid economic reforms will not be met by the current government that is struggling to woo foreign investors. </p><br>\r\n<p>While several disappointed regional parties cried foul, and demanded a recount, the Election Commission remained unavailable for comments.</p><br>\r\n', 'Y'),
(24, ',stk13,stk14,stk15,', 'Hindustan Motors plans to invest Rs 16 billion in new plant', 'hindustanmotors.jpg', '<p> Hindustan Motors, one of India''s oldest automobile manufacturer, plans to invest 16 billion rupees ($262 million) to set up a new manufacturing plant in south India, a source directly involved in the matter said. </p><br>\r\n\r\n<p>Hindustan Motors has signed a preliminary agreement with the Andhra Pradesh government to set up the plant, to be spread across 600 acres, which can produce upto 1.8 million vehicles annually, the source said. </p><br>\r\n\r\n<p>Hindustan Motors, which has three operational plants and one under construction across India, did not have an immediate comment. </p><br>\r\n', ''),
(25, ',stk01,stk02,stk03,', 'Wipro strike may spur M&As', 'wipro.jpg', '<p> The $2.7 billion HCL Technologies acquisition from Wipro has upped the ante for offshore-centric IT players in the global M&A sweepstakes. The deal would pile up pressure on rivals like Infosys Ltd and TCS — struggling to reboot growth — to shift gears in their inorganic plans.</p><br>\r\n\r\n\r\n<p>"Wipro is the new Big Blue. With more than $3 billion in combined healthcare revenue post the acquisition, it positions Wipro in a different league compared to its other Indian peers like Infosys or TCS," said Abhishek Singh, practice director-healthcare in IT and research advisory firm Everest Group.</p><br>\r\n\r\n<p>Tata Consultancy Services (TCS) Ltd and Infosys talked up M&A plans in recent years but have shied away from striking anything big. Wipro could change the narrative and prompt players like Infosys, sitting on over $5 billion in cash, to chase big buyout deals.</p><br>\r\n\r\n', 'Y');
